import React, { useEffect, useRef, useState } from "react";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import "leaflet-routing-machine/dist/leaflet-routing-machine.css";
import "leaflet-routing-machine";
import "./MapComponent.css";

// Fix for Leaflet icon path (Method 1)
delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
  iconRetinaUrl: require("leaflet/dist/images/marker-icon-2x.png"),
  iconUrl: require("leaflet/dist/images/marker-icon.png"),
  shadowUrl: require("leaflet/dist/images/marker-shadow.png"),
});

const MapComponent = ({
  startLocation,
  pickupLocation,
  dropoffLocation,
  tripId,
}) => {
  const mapRef = useRef(null); // Ref to the map container div
  const mapInstance = useRef(null); // Ref to store the leaflet map instance

  const [logEntries, setLogEntries] = useState(null); // State to store the fetched log entries

  useEffect(() => {
    const createMap = async () => {
      if (mapRef.current) {
        // Check if the map container exists AND the map hasn't been initialized yet
        const existingMap = L.DomUtil.get("map"); // Use L.DomUtil.get to check if map already exists

        if (!existingMap?._leaflet_id) {
          // Only initialize if the map hasn't been initialized on this element
          const map = L.map(mapRef.current, {
            center: [40.7128, -74.006],
            zoom: 8,
            scrollWheelZoom: false,
          });

          L.tileLayer("https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png", {
            attribution:
              '© <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors',
          }).addTo(map);

          mapInstance.current = map; // Store the map instance in the ref
        } else {
          console.log("Map already initialized, skipping initialization.");
        }
      }
    };

    createMap();

    return () => {
      if (mapInstance.current) {
        mapInstance.current.remove(); // Clean up the map on unmount
      }
    };
  }, []); // Run only once on mount

  useEffect(() => {
    const fetchLogsAndCreateRouting = async () => {
      if (mapInstance.current && tripId) {
        try {
          // Fetch the logs for the trip
          const logsDataResponse = await fetch(
            `http://localhost:8000/api/trips/${tripId}/logs/`
          );

          if (!logsDataResponse.ok) {
            console.error("Error fetching logs:", logsDataResponse.status);
            return;
          }

          const logsData = await logsDataResponse.json();
          setLogEntries(logsData);

          // Validate log data and extract the coordinates (add safe navigation)
          const startLog = logsData?.[0];
          const pickupLog = logsData?.[7];
          const dropoffLog = logsData?.[9];

          if (!startLog || !pickupLog || !dropoffLog) {
            console.error(
              "Missing log entries for start, pickup, or dropoff location.  Length of the logs is:",
              logsData.length
            );
            return;
          }

          const startCoords = [startLog.latitude, startLog.longitude];
          const pickupCoords = [pickupLog.latitude, pickupLog.longitude];
          const dropoffCoords = [dropoffLog.latitude, dropoffLog.longitude];

          // Create Routing Control
          L.Routing.control({
            waypoints: [
              L.latLng(startCoords),
              L.latLng(pickupCoords),
              L.latLng(dropoffCoords),
            ],
            routeWhileDragging: false,
            showAlternatives: false,
            serviceUrl: "http://router.project-osrm.org/route/v1",
          }).addTo(mapInstance.current);
        } catch (error) {
          console.error("Error fetching or processing logs:", error);
        }
      }
    };

    fetchLogsAndCreateRouting();
  }, [mapInstance.current, tripId]); // Run when map is ready and tripId changes

  return <div id="map" ref={mapRef} style={{ height: "500px" }}></div>;
};

export default MapComponent;
